import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import { Parallax, ParallaxBanner } from 'react-scroll-parallax';



function MainSlider() {
  return (
      <div className="slider">
        <Carousel

        >
          <Carousel.Item>
          <ParallaxBanner
          className="slide_img"
            layers={[
                {
                    image: '/images/slides/slide_1.png',
                    amount: 0.65,
                },
            ]}

            style={{
                textAlign: 'center',
            }}

          >
  
</ParallaxBanner>
          </Carousel.Item>


          <Carousel.Item>
          <ParallaxBanner
          className="slide_img"
            layers={[
                {
                    image: '/images/slides/slide_1.png',
                    amount: 0.65,
                },
            ]}
            style={{
                textAlign: 'center',
                margin: '0',
            }}
          >

        </ParallaxBanner>
          </Carousel.Item>


          <Carousel.Item>
          <ParallaxBanner
          className="slide_img"
            layers={[
                {
                    image: '/images/slides/slide_1.png',
                    amount: 0.65,
                },
            ]}
            style={{
                textAlign: 'center',
                margin: '0',
            }}

          >

        </ParallaxBanner>
          </Carousel.Item>
        </Carousel>
      </div>
  );
}

export default MainSlider;
